func nearestExit(maze [][]byte, entrance []int) int {
	n := len(maze)
	m := len(maze[0])

	queue := make([][3]int, 0)
	i := entrance[0]
	j := entrance[1]

	queue = append(queue, [3]int{i, j, 0})
	maze[i][j] = '+' //  visit 

	for len(queue) != 0 {
		top := queue[0]
		i, j, step := top[0], top[1], top[2]
		if (i == n-1 || j == m-1 || i == 0 || j == 0) && (step > 0) {
			return step
		}
		queue = queue[1:]

		for _, v := range [][]int{
			{0, 1},
			{0, -1},
			{1, 0},
			{-1, 0},
		} {
			ni, nj := i+v[0], j+v[1]
			if ni < n && nj < m && ni >= 0 && nj >= 0 && maze[ni][nj] == '.' {
				// 
				queue = append(queue, [...]int{ni, nj, step + 1})
				maze[ni][nj] = '+' //  visit 
			}
		}
	}
	return -1
}

func nearestExit3(maze [][]byte, entrance []int) int {
	n := len(maze)
	m := len(maze[0])

	queue := list.New()
	i := entrance[0]
	j := entrance[1]

	queue.PushBack([3]int{i, j, 0}) // i,j,step
	//visit := make(map[[2]int]bool)

	maze[i][j] = '+' //  visit 

	for queue.Len() != 0 {
		top := queue.Front()
		topv := top.Value.([3]int)
		i, j, step := topv[0], topv[1], topv[2]
		if (i == n-1 || j == m-1 || i == 0 || j == 0) && (step > 0) {
			return step
		}

		queue.Remove(top)

		for _, v := range [][]int{
			{0, 1},
			{0, -1},
			{1, 0},
			{-1, 0},
		} {
			ni, nj := i+v[0], j+v[1]
			if ni < n && nj < m && ni >= 0 && nj >= 0 && maze[ni][nj] == '.' {
				// 
				queue.PushBack([...]int{ni, nj, step + 1})
				maze[ni][nj] = '+' //  visit 
			}
		}
	}
	return -1
}

func nearestExit2(maze [][]byte, entrance []int) int {
	n := len(maze)
	m := len(maze[0])

	list := make([][3]int, 0)
	i := entrance[0]
	j := entrance[1]

	list = append(list, [3]int{i, j, 0}) // i,j,step
	//visit := make(map[[2]int]bool)

	for len(list) != 0 {
		top := list[0]
		i, j, step := top[0], top[1], top[2]
		list = list[1:]

		maze[i][j] = '+' //  visit 

		for _, v := range [][]int{
			{0, 1},
			{0, -1},
			{1, 0},
			{-1, 0},
		} {
			ni, nj := i+v[0], j+v[1]
			if maze[ni][nj] == '.' && ni < n && nj < m && ni >= 0 && nj >= 0 {
				// 
				if ni == n-1 || nj == m-1 || ni == 0 || nj == 0 {
					//
					return step + 1
				} else {
					list = append(list, [...]int{ni, nj, step + 1})
				}
			}
		}
	}
	return -1
}

func nearestExitDfs(maze [][]byte, entrance []int) int {
	n := len(maze)
	m := len(maze[0])

	min := func(arr ...int) int {
		x := math.MaxInt / 2
		for _, v := range arr {
			if v == -1 {
				continue
			}
			if v < x {
				x = v
			}
		}
		if x == math.MaxInt/2 {
			return -1
		}
		return x
	}

	var dfs func(i, j int) int
	dfs = func(i, j int) int {
		if i >= n || j >= m || i < 0 || j < 0 || maze[i][j] == '+' {
			return -1
		}

		//if i == n-1 || j == m-1 || i == 0 || j == 0 {
		if (i == n-1 || j == m-1 || i == 0 || j == 0) && (i != entrance[0] || j != entrance[1]) {
			return 0
		}

		maze[i][j] = '+'
		ans := min(
			dfs(i, j+1), // 
			dfs(i-1, j), // 
			dfs(i, j-1), // 
			dfs(i+1, j), // 
		)

		if ans == -1 {
			return -1
		}
		return ans + 1
	}

	return dfs(entrance[0], entrance[1])
}
